import { FaShoppingCart } from "react-icons/fa";
import { useSelector } from "react-redux";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  const { cart } = useSelector((state) => state);

  return (
    <div>
      <nav className="bg-green-600 text-white h-20 max-w-6xl mx-auto flex justify-between items-center px-5">
        <NavLink to="/">
          <div className="ml-5">
            <img src="../logo.png" className="h-14" alt="Logo" />
          </div>
        </NavLink>

        <div className="flex items-center font-medium text-lg space-x-6">
          <NavLink to="/" className="hover:text-gray-300">
            Home
          </NavLink>

          <NavLink to="/cart" className="relative hover:text-gray-300">
            <FaShoppingCart className="text-2xl" />
            {cart.length > 0 && (
              <span className="absolute -top-1 -right-2 bg-red-600 text-xs w-5 h-5 flex justify-center items-center animate-bounce rounded-full text-white">
                {cart.length}
              </span>
            )}
          </NavLink>
        </div>
      </nav>
    </div>
  );
};

export default Navbar;
